import React from "react";
import "./style.css";

const LandingPage = () => {
    return (
        <div className="landing">
            <h1 className="welcome-title">Welcome to Genius Music</h1>
            <h2 className="welcome-subtitle">Please login to continue</h2>
        </div>
    );
}

export default LandingPage;
